import './App.css';
import Card from './Components/Card';

function App() {
  return (
    <div className="App">
        <Card 
          title = "Arjun"
          imglink = "https://qph.cf2.quoracdn.net/main-qimg-3ac1bac314562f7068424c091fe62b4d-lq"
          info = "The greatest Archer in the world"
        />
    </div>
  );
}

export default App;
